import React from "react";
import "./App.css";
import Header from "./components/Header";
import Slider from "./components/Slider";


function App() {
  return (
    <>
      <Header />
      <main id="main">
        <Slider />
        <Image />
        <ImageText />
        <Card />
        <Banner />
        <Text />
      </main>
      <Footer />
    </>
  );
}

export default App;
